var FeedbackVue=new Vue({el:"#feedback-vue",data:{feedback:{title:null,text:null,priority:3,topic:"Want",status:"new",images:[]},imagesNumber:0,isSaving:!1,viewOne:!0},watch:{},mounted:function(){},methods:{encodeImageFileAsURL:function(n){var i=n.target.files[0],t=new FileReader;t.onloadend=function(){FeedbackVue.feedback.images.push({id:FeedbackVue.imagesNumber,imageBase64:t.result});FeedbackVue.imagesNumber++};t.readAsDataURL(i)},removeImage:function(n){let t=this.feedback.images.findIndex(t=>t.id==n.id);this.feedback.images.splice(t,1)},choosedMood:function(n,t){$(".feeling i").removeClass("active");$(n.target).addClass("active");this.feedback.moodID=t},save:function(){return this.isSaving=!0,$.ajax({type:"Post",url:"/Feedback/SaveFeedback",contentType:"application/json",data:JSON.stringify(this.feedback),dataType:"json",context:this,success:function(n){n.isOk&&(this.viewOne=!1);this.isSaving=!1}})}}});